import { Button, FormControl, InputLabel, OutlinedInput, TextField } from "@mui/material";
import React from "react";
import { useNavigate } from "react-router-dom";
import { useAppDispatch } from "../../hooks";
import { login } from "../../services/auth.service";
import { setUserData } from "../../storage/auth.storage";

const LoginForm = () => {
  const dispatch = useAppDispatch();
  const navigate = useNavigate();
  const [error, setError] = React.useState(null);

  const onLoginSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    const email = event.currentTarget.username.value;
    const password = event.currentTarget.password.value;

    login(email, password)
      .then((res) => {
        setUserData(dispatch, res.accessToken, res.refreshToken, { userName: res.userName, email: res.userEmail, roles: res.userRoles });
        setError(null);
        // ..navigate
      })
      .catch((e) => {
        console.log(e);
        // ..error
      });
  };

  return (
    <form onSubmit={onLoginSubmit}>
      <TextField type="text" label="Username" variant="outlined" />
      <br />
      <TextField type="password" label="Password" variant="outlined" />
      <br />
      <Button variant="contained" type="submit">Submit</Button>
    </form>
  );
};

export default LoginForm;
